export const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "삭은이",
        content: "첫번째 게시글 #태그",
        Images: [
          {
            src: "https://www.google.com/imgres?imgurl=https%3A%2F%2Flookaside.fbsbx.com%2Flookaside%2Fcrawler%2Fmedia%2F%3Fmedia_id%3D686245404771741&imgrefurl=https%3A%2F%2Fwww.facebook.com%2Fmutnam%2Fposts%2F686246238104991%2F&tbnid=dRrxeUyU38gWPM&vet=12ahUKEwijra6emcjxAhUGHqYKHeBdBYsQMygEegUIARCeAQ..i&docid=1fyj6-fz0gBC5M&w=720&h=720&q=%EB%A9%8B%EB%82%A8&ved=2ahUKEwijra6emcjxAhUGHqYKHeBdBYsQMygEegUIARCeAQ",
          },
        ],
      },
    },
  ],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
